import React from 'react';

import './register-page.css';

const RegisterPage = () => {


    const handleRegisterInputChange = e => {
        setLoginData({
            ...loginData,
            [e.target.name]: e.target.value
        })
    }

    return (
        <form
            className="login-form"
            // onSubmit={}
            >
            <input
                type="email"
                name="email"
                className="login-form__input"
                placeholder="Email"
                required
                onChange={handleRegisterInputChange} 
                />
            <input
                type="password"
                name="password"
                className="login-form__input"
                placeholder="Пароль"
                required
                // onChange={} 
                />
            <button
                type="submit"
                className="login-form__button">Зарегистрироваться</button>
        </form>
    )
}

export default RegisterPage;
